sc_cat_item_producer.script:
// Set the short description to reflect the item and location
current.short_description = 'Reservation: ' + current.u_item_type.getDisplayValue() + ' from ' + current.u_depot.getDisplayValue();
current.u_location_to_be_used = producer.u_location_to_be_used;
if (producer.u_location_to_be_used == "Other") {
   current.u_location_to_be_used = producer.u_other;
}

// Set the initial state to requested
current.state = 13;
